import { Card } from "antd";

export const DataTile = () => {
  return (
    <Card style={{ borderRadius: "8px", width: "200px", height: "200px" }}>
     <h2>110 PiB</h2>
     <h1>110 PiB</h1>
    </Card>
  );
};

export default DataTile;
